import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Alert = ({ variant, children }) => {
    const alertClass = `alert alert-${variant}`;
    
    return (
        <div className={alertClass} role="alert">
            {children}
        </div>
    );
};

export default Alert;
